import React, {Component} from 'react'; 
import foto0 from '../IMG/foto0.jpg';
import { log } from 'util';
class cabeza extends Component{
    state={};

    render(){
        return(
            <ImageBackground
          style={{width: 50, height: 50}}
          source={foto0}
            >
            <Text>Texto</Text>
            </ImageBackground>
        )
    }
}
export default cabeza;
